        if(this.props.chartsTicker){
             tickerDisplayed = (
                <div>
                    {this.props.chartsTicker}
                </div>
            )
        }
        return (
            <Fragment>
            <div className="chart-header">
                <div>
                     
                </div>
                <div  style={{width:"100px"}}>
                    <SelectItem/>
                </div>
            </div>
            </Fragment>
        )
    }
}
